import {
BrowserRouter as Router, Route, Routes, useNavigate } from "react-router-dom";
import { Bs1CircleFill, BsArrowRight, BsArrowLeft } from "react-icons/bs";
import AbdomenSelector from "../components/Abdomen/AbdomenSelector";

const AbdomenPage: React.FC = () => {
    const navigate = useNavigate();

    const handleNext = () => {
      navigate("/finger"); // Navigate to Finger Selector page
    };

    return (
      <div className="min-h-screen bg-gray-100 flex flex-col items-center justify-center">
        <h3 className="text-2xl font-normal mb-6 flex items-center">
          <Bs1CircleFill className="mr-2" />
          Select Pain Areas (Abdomen)
        </h3>
        <AbdomenSelector />
        <div className="flex justify-between items-center mt-10">
          <button className="btn btn-primary text-black border-none shadow-none bg-transparent hover:text-primary hover:bg-transparent transition-colors duration-200">
            <BsArrowLeft /> Previous
          </button>
          <button
            className="btn btn-primary text-black border-none shadow-none bg-transparent hover:text-primary hover:bg-transparent transition-colors duration-200"
            onClick={handleNext}
          >
            Next <BsArrowRight />
          </button>
        </div>
      </div>
    );
  };

  export default AbdomenPage;
